function TimerDisplay(props){

    return (
        <div className = "timer-display"><div className = "timer"> 
            <span > {(props.timer.m >= 10)? props.timer.m : "0"+ props.timer.m}</span>&nbsp;:&nbsp;
            <span > {(props.timer.s >= 10)? props.timer.s : "0"+ props.timer.s}</span>&nbsp;&nbsp;
            </div>
        </div>
    );
}

export default TimerDisplay;
